import React from 'react';
import S from './Interes.module.css'
import { useState } from 'react';
const Interes = () => 
{
    const [interes, ChangeInteres] = useState("Ебаться в жопу")
    return(
        <div className={S.wrapper}>
     <div className={S.Interes} onClick={() => ChangeInteres("Сосать хуй")}>
         {interes}
     </div>
     </div>
    )
}

export default Interes;
